import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { Link } from 'react-router-dom';

function NavScrollExample() {
    const isLogin = !!localStorage.getItem('user')

    const logout = () => {
        localStorage.removeItem('user')
    }

    return (
        <Navbar expand="lg" className="bg-dark-subtle">
            <Container fluid>
                <Navbar.Brand className='fw-bold' href={'/'}>PHOTOGRAPH</Navbar.Brand>
                <Navbar.Toggle aria-controls="navbarScroll" />
                <Navbar.Collapse id="navbarScroll">
                    <div className='ms-auto d-flex flex-row justify-content-center align-items-center gap-3'>
                        <Form className="d-flex">
                            <Form.Control
                                type="search"
                                placeholder="Search"
                                className="me-2"
                                aria-label="Search"
                            />
                            <Button variant="outline-success">Search</Button>
                        </Form>
                        {
                            isLogin ? (
                                <NavDropdown title="USERS" id="navbarScrollingDropdown">
                                    <NavDropdown.Item href="#action3" onClick={logout}>Action</NavDropdown.Item>
                                    <NavDropdown.Item href="#action4">
                                        Another action
                                    </NavDropdown.Item>
                                    <NavDropdown.Divider />
                                    <NavDropdown.Item href="#action5">
                                        Something else here
                                    </NavDropdown.Item>
                                </NavDropdown>
                            ) : (
                                <Link to={'/login'} className='btn btn-success'>Login</Link>
                            )
                        }
                    </div>

                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
}

export default NavScrollExample;
